export var ActionToggleAppearance;
(function (ActionToggleAppearance) {
    ActionToggleAppearance["justified"] = "justified";
    ActionToggleAppearance["lightweight"] = "lightweight";
    ActionToggleAppearance["outline"] = "outline";
    ActionToggleAppearance["primary"] = "primary";
    ActionToggleAppearance["stealth"] = "stealth";
})(ActionToggleAppearance || (ActionToggleAppearance = {}));
